import React, { Component } from 'react';

class ClientList extends Component {
    state = {
        clients: [
            {
                name: 'משה',
                phoneNumber: '052-8090399',
                adress: 'הר הצופים 29 ',
                city: 'חולון'
            },

            {
                name: 'ג׳ניפר',
                phoneNumber: '052-1234567',
                adress: 'שקר כל שהוא ',
                city: 'חולון'
            },

            {
                name: 'דיאנה',
                phoneNumber: '052-1234567',
                adress: 'שקר כל שהוא ',
                city: 'חולון'
            },


        ]
    }

    render() {
        return (
            this.state.clients.map(client => {

                <div>
                    <span>{this.state.client.name}</span>
                    <span>{this.state.client.phoneNumber}</span>
                    <span>{this.state.clients.adress}</span>
                    <span>{this.state.clients.city}</span>
                </div>
            }))
        }}






export default ClientList;
